import React from "react";
import { StyleSheet, Text, View } from "react-native";

const CustomarCare = () => {
  return (
    <View>
      <Text>CustomarCare CustomarCare</Text>
    </View>
  );
};

export default CustomarCare;

const styles = StyleSheet.create({});
